ggfluctuation_my <- function (mat, rsd, maxv){
	if (nrow(mat) > 1){
		mat <- mat[nrow(mat):1,]
		rsd <- rsd[nrow(rsd):1,]
	}
	
	# preparing the data.frame
	table <- NULL
	for (r in 1:nrow(mat)){
		for (l in 1:ncol(mat)){
			table <- rbind(table, c(r, l, mat[r,l], rsd[r,l]))
		}
	}
	table <- data.frame(
		x	  = as.factor(table[,2]),
		y	  = as.factor(table[,1]),
		result = table[,3],
		rsd    = table[,4]
	)
	table <- subset(table, result > 0)

	if (color_fix == 1){
		table$rsd[table$rsd >  maxv     ] <- maxv
		table$rsd[table$rsd <  maxv * -1] <- maxv * -1
	}

	# Set up the plot
	p <- ggplot(
		table,
		aes_string(
			x = "x",
			y = "y",
			size = "result",
			fill = "rsd"
		)
	)

	# Basic points
	if (color_rsd == 1){
		p <- p + geom_point(
			shape=ifelse(bubble_shape==0, 22, 21),
			colour = "black",
			alpha=alpha_value
		)
	} else {
		p <- p + geom_point(
			shape=ifelse(bubble_shape==0, 22, 21),
			colour="black",
			fill="gray30",
			alpha=alpha_value
		)
	}

	# Fill color
	if (color_rsd == 1){
		limv = max( abs( table$rsd ) )
		if ( color_fix == 1 ){
			limv <- maxv
		}
		if (color_gry == 1){
			p <- p + scale_fill_gradientn(
				colours = paste("gray",95:1, sep=""),
				limits = c( limv * -1, limv ),
				guide = guide_legend(
					title = "Pearson rsd.",
					order = 1,
					override.aes = list(size=6, shape=22),
					label.hjust = 1,
					reverse = TRUE,
					keyheight = unit(1.5,"line")
				)
			)
		}
		else if (color_universal_design == 0){
			p <- p + scale_fill_gradientn(
				colours = cm.colors(99),
				limits = c( limv * -1, limv ),
				guide = guide_legend(
					title = "Pearson rsd.",
					order = 1,
					override.aes = list(size=6, shape=22),
					label.hjust = 1,
					reverse = TRUE,
					keyheight = unit(1.5,"line")
				)
			)
		} else {
			library(RColorBrewer)
			myPalette <- colorRampPalette(rev(brewer.pal(5, "RdYlBu"))) #Spectral
			
			p <- p + scale_fill_gradientn(
				colours = myPalette(100),
				limits = c( limv * -1, limv ),
				na.value = "black",
				guide = guide_colourbar(
					title = "Pearson rsd.:\n",
					title.theme = element_text(
						face="bold",
						size=11,
						lineheight=0.4,
						angle=0
					),
					label.hjust = 1,
					order = 1
				)
			)
		}
	}

	# bubble plot legend configuration
	limits_a <- c(0.05, ceiling(max(table$result)));
	if (is.null(breaks)){
		breaks <- labeling::extended(
			0.05,
			max(table$result, na.rm=T),
			5
		)
		breaks_a <- NULL
		for ( i in 1:length(breaks) ){
			if (
				   0.05 <= breaks[i]
				&& max(table$result, na.rm=T) >= breaks[i]
			){
				breaks_a <- c(breaks_a, breaks[i])
			}
		}
		breaks <- breaks_a
	} else {
		breaks_a <- breaks
		if (  min(breaks) < 0.05 ){
			limits_a[1] <- min(breaks)
		}
		if (  max(breaks) > max(table$result, na.rm=T) ){
			limits_a[2] <- max(breaks)
		}
	}
	breaks_a <<- breaks_a

	p <- p + scale_size_area(
		breaks = breaks_a,
		limits = limits_a,
		max_size = 15*bubble_size,
		guide = guide_legend(
			title = "\nPercent:",
			override.aes = list(alpha = 1, fill=NA),
			label.hjust = 1,
			order = 2
		)
	)

	# labels of axis
	p <- p + scale_x_discrete(
		breaks = 1:ncol(mat),
		labels = colnames(mat),
		expand = c(0.015, 0.5)
	)
	p <- p + scale_y_discrete(
		breaks = 1:nrow(mat),
		labels = rownames(mat),
		expand = c(0.015, 0.5)
	)

	# other cofigs of the plot
	nx <- length(levels(table$x))
	ny <- length(levels(table$y))
	p <- p + theme_classic()
	p <- p + theme(
		#aspect.ratio = ny/nx,
		#legend.background=element_rect(fill="gray96",colour = NA),
		legend.key=element_rect(fill=NA,colour = NA),
		legend.title = element_text(face="bold",  size=11, angle=0),
		legend.text  = element_text(face="plain", size=11, angle=0),
		plot.margin =   unit(c(0.25, 0.01, 0.25, 0.25), "cm"),
		axis.line.x    = element_line(colour = "black", size=0.5),
		axis.line.y    = element_line(colour = "black", size=0.5),
		panel.grid.major = element_line(
			colour = "gray50",
			size=0.25
		),
		panel.grid.major.x = element_line(
			colour = "gray50",
			size=0.25
		),
		panel.grid.major.y = element_line(
			colour = "gray50",
			size=0.25
		),
		axis.title.y     = element_blank(),
		axis.title.x     = element_blank(),
		axis.ticks       = element_blank(),
		axis.text.x=element_text(
			size=12 * cex,
			colour="black",
			angle=90,
			hjust=1
			#family=font_fam
		),
		axis.text.y=element_text(
			size=12 * cex,
			colour="black",
			hjust=1
			#family=font_fam
		)
	)

	if ( is.null(font_fam) == FALSE ){
		p <- p + theme(
			axis.text.x=element_text(
				size=12 * cex,
				colour="black",
				angle=90,
				hjust=1,
				family=font_fam
			),
			axis.text.y=element_text(
				size=12 * cex,
				colour="black",
				hjust=1,
				family=font_fam
			)
		)
	}
	print(p)
}

